import './App.css';
import Countdown from 'react-countdown';
import { useState } from 'react';

function App() {
  const [num, setNum] = useState();

  const Inc = ()=>{
    setNum
  }
  return (
    <div className="App">
      <button onClick = {Inc}></button>
    </div>
  );
}

export default App;
